此处记录的是{{color|red|派趣服专设}}的海域6-Ex01及可能的后续海域。

== 海域特征 ==

=== 6-Ex01 ===

#敌方每一点每一种配置都有[[战舰少女:敌航空母舰|CV]]/[[战舰少女:敌轻型航母|CVL]]，对小船不太友好。若上战列、战巡和航母的话能缓解一下问题，然而……
#6-Ex01两个迂回点的敌方平均航速均为31/33/33。若上大船的话，只有[[战舰少女:翔鹤|翔鹤]]、[[战舰少女:瑞鹤|瑞鹤]]的航速稍微能减少一些脸的成分；不济的话可以尝试[[战舰少女:列克星敦|列克太太]]和[[战舰少女:萨拉托加|小姨子]]。不过无论如何配置，只要上大船，4战都很看脸。
#派趣在此图重新放出了1.1.6版本中试验投放的'''{{coloredlink|red|战舰少女:敌战列舰|战列Λ级Ⅳ型}}'''<ref>游戏中一直误记做“战列Μ级Ⅳ型”，与出现于6-1、6-2的真正的'''{{coloredlink|red|战舰少女:敌战列舰|战列Μ级Ⅳ型}}'''发生混淆，该错误未修正。</ref>，以及新设计的'''{{coloredlink|red|战舰少女:敌轻型航母|轻母Ξ级Ⅳ型}}'''和早已完成设计只待登场的'''{{coloredlink|red|战舰少女:敌航空母舰|航母Ο级Ⅳ型}}'''。
#面对高命中的[[战舰少女:敌战列舰|战列Λ级Ⅳ型]]、[[战舰少女:敌战列巡洋舰|战巡Κ级Ⅳ型]]和强化鱼雷机的[[战舰少女:敌轻型航母|轻母Ξ级Ⅳ型]]、[[战舰少女:敌航空母舰|航母Ο级Ⅳ型]]，小船的闪避非常重要。可以说此处是[[战舰少女:空想|空想改]]的舞台。

=== 6-Ex02 ===

#F、I两点为'''开幕夜战'''，且仅有夜战。
#{{color|red|派趣服1.4.0版本中，开幕夜战时，敌方的攻击力相比普通夜战，遭到了极大的削弱。}}多数情况下，被命中时仅有擦伤。推测开幕夜战点中，敌舰只有在暴击命中时才会产生正常伤害，正常命中时只造成擦伤。
#考率到夜战消耗弹药少，5战似乎可行？当能经过B-I时，即使4战也能满火力到达BOSS点。
#上路C点为迂回点，敌方平均航速为33/32/32。然而固定线路需要2航母，迂回难度较高，等待其他配置进C点也较困难。
#6-Ex02的敌舰强度及到达BOSS点难度与6-Ex01相比低不少。6-Ex01中的明星单位也未再次登场。

=== 6-Ex03 ===

#此图无沟，无开幕夜战，难度比6-Ex02低。
#带2艘轻母可以走3战路线。
#不推荐带潜艇走下路，因为H点有6反潜舰+单横阵的专克潜艇的配置。

=== 明星单位 ===

'''{{coloredlink|red|战舰少女:敌战列舰|战列Λ级Ⅳ型}}'''

在6-Ex01中是稳定的BOSS点旗舰，门神点也有2/3概率出现。该单位目前等级为Lv98，装有命中+15的雷达，HP高达130，装甲高达110，火力也堆到了150(110+40)。可以说在攻防能力上十分完美，唯一缺陷是仅有24节的航速——然而在该图中总有其他高速航母将平均航速提到一个“适当{{黑幕|令人吐血}}”的水准。

'''{{coloredlink|red|战舰少女:敌航空母舰|航母Ο级Ⅳ型}}'''

HP有高出[[战舰少女:敌战列舰|战列Λ级Ⅳ型]]相当多的160，装甲也是极高的120{{黑幕|，说达到美国核动力航母的水准也不为过}}。并且该单位具备极高的搭载、新型战斗机和鱼雷机，可以说是比战列Λ级Ⅳ型更加难缠的单位。好在出现概率只有1/3，而且不是旗舰。

